import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import headerLogo from '../images/header-logo.svg';

function Header() {
  // const navigate = useNavigate();

  // function signOut() {
  //   localStorage.removeItem('jwt');
  //   navigate('/login');
  // }

  return (
    <header className="header">
      <img src={headerLogo} alt="Логотип Место" className="logo" />
      <button
        type="submit"
        className="header__button-authentication header__login"
        aria-label="Перейти"
        //onClick={signIn}
      >
        <Link to="/sign-in" className="header__button-title">
          Войти
        </Link>
      </button>
      <button
        type="submit"
        className="header__button-authentication header__logup"
        aria-label="Перейти"
        //onClick={signUp}
      >
        <Link to="/sign-up" className="header__button-title">
          Регистрация
        </Link>
      </button>
    </header>
  );
}

export default Header;
